        {% block stylesheets %}
        {% endblock stylesheets %}

        {% block javascripts %}
        {% endblock javascripts %}
    </head>
    <body>
        {% block body %}
            <header>
                {% block header %}
                    <div class=\"header_logo\">
                        <a>{% block logo %}Shopping{% endblock logo %}</a>
                    </div>
                    <nav>
                        <ul>
                            <li><a href=\"{{ path('calculate-price')}}\">Calculate</a></li>
                            <li><a href=\"{{ path('purchase')}}\">Purchase</a></li>
                        </ul>
                    </nav>
                {% endblock %}
            </header>
            {% block h3 %}
            <br><h3>Click \"Calculate\" if you want to get a price</h3></br>
            <h3>Click \"Purchase\" if you want to buy</h3>
            {% endblock h3 %}
            <div class=\"center_block_main\">
             
                <main>
                    {% block main %}
                        <div class=\"table\">  
                            <table>
                                <thead>
                                    <tr>
                                        {% block name_product %}
                                        {% endblock name_product %}\t
                                    </tr>
                                </thead>
                                <tbody>
                                    
                                        {% block price_product %}
                                        {% endblock price_product %}
                                    
                                </tbody>
                            </table> 
                        </div> 
                        <div class=\"form\">
                            {% block h2_calculate_price %}
                            {% endblock h2_calculate_price %}
                            <fieldset>
                                <legend>{% block legend %}{% endblock legend %}</legend>
                                    <table>
                                        <tr>
                                            {% block form_calculate_price %}
                                            {% endblock form_calculate_price %}
                                        </tr>
                                    </table> 
                           <fieldset>
                        </div> 
                        <div class=\"table\">  
                            <table>
                                <thead>
                                    <tr>
                                        {% block table_calculate_price %}
                                        {% endblock table_calculate_price %}\t
                                    </tr>
                                </thead>
                                <tbody>
                                    
                                        {% block tbody_calculate_price %}
                                        {% endblock tbody_calculate_price %}
                                    
                                </tbody>
                            </table>    
                        </div> 
                        <div class=\"form\">
                            <fieldset>
                                <legend>{% block legend_response %}{% endblock legend_response %}</legend>
                                    <table>
                                        <tr>
                                            {% block json_response %}
                                            {% endblock json_response %}
                                        </tr>
                                    </table> 
                           <fieldset>
                        </div> 
                    {% endblock %}
                </main>
            </div>
        {% endblock %}
    </body>
</html>
